function flatternCategoryGroups(cgs, isRPC) {
	if (isRPC) {
		const result = cgs.map(cg => ({
			"label": cg.name,
			"options": cg.categories.map(c => ({
				"label": c.name,
				"value": c.id
			}))
			.sort((a, b) => (a.label.toUpperCase() < b.label.toUpperCase())? -1 : 1)
		}))
		.filter(cg => cg.options.length > 0)
		.sort((a, b) => (a.label.toUpperCase() < b.label.toUpperCase())? -1 : 1);
		return result;
	} else {
		let cs = [];
		cgs.forEach(cg => cg.categories.forEach(c => cs.push({
			"category_group_name": cg.name,
			...c
		})));
		return cs;
	}
}

